import image from "../image"

function SingIn() {
    const css = {
        body : {
            width: '100%',
            height: '600px',
            backgroundColor: '#070e17'
        },
        window : {
            width: '500px',
            height: '600px',
            backgroundColor: 'red'
        },
    }
    return (
        <div style={css.body}>
            <div style={css.window}>
                LOL

            </div>

        </div>
    )
}
export default SingIn
